import React, {Fragment} from 'react';
import {Typography} from '@material-ui/core';
import 'fontsource-roboto';
import { withStyles } from '@material-ui/core/styles';

//import <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap" />


const StyledDie = withStyles({
  root: {
    margin: '5px',
    border: '5px',
    backgroundColor: '#a1887f',
    color: '#efebe9',
    width: '63px',
    height: '63px',
    borderRadius: '5px',
    display: 'table-cell',
    verticalAlign: 'middle',
    textAlign: 'center'
  }
})(Die);



function Die({id, roll}){

    console.log(`printing die ${id} letter `,roll)

    return (
        <div>`${roll.x},${roll.y} - ${roll.content} ` </div>      
    )
}    

export default Die
